import React from "react";
import { Select } from "antd";

interface SelectRickProps {
  onSearch: (value: string) => void;
}

const SelectRick: React.FC<SelectRickProps> = ({ onSearch }) => {
  const handleChange = (value: { value: string; label: React.ReactNode }) => {
    onSearch(value);
  };
  return (
    <Select
      labelInValue
      defaultValue={{ value: "lucy", label: "Lucy (101)" }}
      style={{ width: 120 }}
      onChange={handleChange}
      options={[
        {
          value: "jack",
          label: "Jack (100)",
        },
        {
          value: "lucy",
          label: "Lucy (101)",
        },
      ]}
    />
  );
};

export default SelectRick;
